import React , {Component} from 'react';
import App from './App';
class Items extends Component{
    render()
    {
      const {id,age,name} = this.nom; 
      return (
        <div>
        <p>{name}</p>
        <p>{age}</p>
        <p>{id}</p>
        </div>
        )
    }
}
export default Items;
